/*Table structure for table `t_article` */

DROP TABLE IF EXISTS `t_article`;

CREATE TABLE `t_article` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `articlename` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '文章名称',
  `articletime` datetime DEFAULT NULL COMMENT '发布时间',
  `articleip` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '发布ip',
  `articleclick` int(10) DEFAULT NULL COMMENT '查看人数',
  `articletype` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '所属分类',
  `userid` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '所属用户id',
  `articlemodle` char(2) COLLATE utf8_bin DEFAULT '1' COMMENT '文章的模式:0为私有，1为公开，2为仅好友查看',
  `articlecontent` text COLLATE utf8_bin NOT NULL COMMENT '文章内容',
  `articlesupport` char(2) COLLATE utf8_bin DEFAULT '0' COMMENT '是否博主推荐:0为否，1为是',
  PRIMARY KEY (`id`,`userid`),
  KEY `FK_article_to_t_user` (`userid`),
  KEY `FK_article_to_t_articletype` (`articletype`),
  CONSTRAINT `FK_article_to_t_articletype` FOREIGN KEY (`articletype`) REFERENCES `t_articletype` (`id`),
  CONSTRAINT `FK_article_to_t_user` FOREIGN KEY (`userid`) REFERENCES `t_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

