  `articletypename` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文章分类名称',
  PRIMARY KEY (`id`),
  KEY `FK_t_articletype_to_t_user` (`userid`),
  CONSTRAINT `FK_t_articletype_to_t_user` FOREIGN KEY (`userid`) REFERENCES `t_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

