/*Table structure for table `t_comment` */

DROP TABLE IF EXISTS `t_comment`;

CREATE TABLE `t_comment` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `touserid` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '收到评论的用户',
  `tocommenttype` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '评论栏目ID',
  `tocommentpoint` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '评论内容的ID',
  `commentcontent` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '评论内容',
  `fromcommentid` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '评论者ID',
  `commenttime` datetime DEFAULT NULL COMMENT '评论时间',
  `formcommentip` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '评论时的IP地址',
  PRIMARY KEY (`id`),
  KEY `FK_t_comment_t_user` (`touserid`),
  CONSTRAINT `FK_t_comment_t_user` FOREIGN KEY (`touserid`) REFERENCES `t_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `t_comment` */

/*Table structure for table `t_group` */

DROP TABLE IF EXISTS `t_group`;

CREATE TABLE `t_group` (
  `groupid` varchar(64) COLLATE utf8_bin NOT NULL,
  `groupname` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `createdate` datetime DEFAULT NULL,
  `updatedate` datetime DEFAULT NULL,
  `remark` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`groupid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `t_group` */

/*Table structure for table `t_menu` */

DROP TABLE IF EXISTS `t_menu`;

CREATE TABLE `t_menu` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '菜单id',
  `menuname` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单名称',
  `menutext` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单内容',
  `pid` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '所属父级菜单',
  `type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单类型',
  `url` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '访问url',
  `orderstring` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '排序',
  `createdate` datetime DEFAULT NULL COMMENT '创建时间',
  `updatedate` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `t_menu` */

/*Table structure for table `t_photos` */

DROP TABLE IF EXISTS `t_photos`;

CREATE TABLE `t_photos` (
  `id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'id',
  `photoname` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '照片名称',
